VALUES ('5602477801804', 'Gelée saveur Fraise (2 sachets 85gr)', 'MODO DE PREPARAÇÂO 1. Ferva 250ml (1/4 de litro) de âgua; 2 Verta o conteüdo de uma saqueta num recipiente e junte a âgua a fervea 3. Mexa até dissolver totalmente; 4. Junte 250ml (1/4 de litro) de âgua fria e leve ao frigorifico até adquirir consistência. Ingredientes: Açücar, gelatina (12%), reguladores de acidez (E330, E297 e E331), aromas (contém sulfitos), sal, corantes (El 20, El 63 e El 60aii) e antioxidante (Vitamina C). Pode conter glüten, leite, frutos de casca rija, soja, sementes de mostarda e amendoins.', 'https://static.openfoodfacts.org/images/products/560/247/780/1804/front_fr.9.400.jpg', '0', '0', '86', '85', '', '12', '0.62', '0.244094488188976', '', '0');

